	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'000d0d8c-b92f-e711-80df-00248c445d9c', N'We Are Back, and Updates are Coming!', N'A large infrastructure update to our data center has been performed. And the existing software has been refactored for performance and reliability. This is in anticipation of resuming monthly updates after our little software update... Um... hiatus?    : )', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20170502 11:32:00.000', '20170502 11:32:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'04ff74da-fd39-e711-80df-00248c445d9c', N'User Interface Updates', N'We have updated our website UI to make it easier to edit your data, especially from tablets and mobile devices.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20170516 01:06:00.000', '20170516 01:06:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'0b8d85bd-39e8-e311-821b-00215e73190e', N'Budget Page Released!', N'The main budget page has been released for usage by the beta community. See Help Videos for more information on how to create and use your first Zero Based Budget!', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140106 20:20:43.000', '20140106 20:20:43.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'38249a46-6b64-e711-80e0-00248c445d9c', N'Fixed User Lock Notification', N'A bug was fixed where users were not being properly told that their account was locked due to too many failed logins and how to fix that issue.', N'3dc480f1-5586-e311-821b-00215e73190e', 2, 1, '20170709 23:55:00.000', '20170709 23:55:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'39c55f19-6b64-e711-80e0-00248c445d9c', N'Email and Site Alerts for Budget Items', N'Budget Items can now have Friendly and Warning Alerts which can be setup for different days. Currently Alerts can support sending email reminders, mobile phone text Alerts are coming soon!', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20170701 23:35:00.000', '20170701 23:35:00.000', N'James', NULL, NULL)
