	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'73822771-5c10-e411-91eb-00215e73190e', N'Easier Account Management', N'You can now setup reoccuring payments and charges for your accounts and apply them once a month by pressing a single button. This helps simplify account management for payments and charges which aren''t  linked to budgets but which you still want to easily manage.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140720 05:23:00.000', '20140720 05:23:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'7e07ba81-3ce8-e311-821b-00215e73190e', N'Critical Bug Fix!', N'Fixed the budget saving bug that was introduced with the Account Linking functionality, budget changes to non-linked items will now save again.', N'3dc480f1-5586-e311-821b-00215e73190e', 2, 1, '20140512 12:27:00.000', '20140512 22:27:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'7f11de15-603c-e711-80df-00248c445d9c', N'UI and Page Load Time Updates', N'Performance and usability have been our main focus this month, and we have been able to dramatically decrease initial page load time under certain circumstances. Enjoy!', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20170519 12:12:00.000', '20170519 12:12:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'84e53312-3ae8-e311-821b-00215e73190e', N'Budget Pie Charts Released', N'Now you can view handy visual pie charts to let you know how much money you have budgeted, what you have spent, and how much money you still have available given your current income.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140119 01:15:28.000', '20140119 01:15:28.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'84fe9884-2a28-e411-bdbf-00215e73190e', N'Reports Engine Online', N'You can now start analyzing your data! The basic reports engine has been completed and budget reports are now available. More features to reports will be coming very soon.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140820 23:26:00.000', '20140820 23:26:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'880772a5-38e8-e311-821b-00215e73190e', N'Credit Accounts Now Available', N'Added support for secured (i.e. mortgage) and unsecured (i.e. credit card) credit accounts.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140424 22:06:00.000', '20140424 22:06:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'88bb9fd0-a217-e411-91eb-00215e73190e', N'Easier Current Spending Analysis', N'On the Monthly Budget Page, the two pie charts showing Planned Spending vs. Actual Spending were replaced with a grouped horizontal bar chart showing the same data in a more easily understandable format.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140729 23:34:00.000', '20140729 23:34:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'972a1f05-3be8-e311-821b-00215e73190e', N'Welcome and News Pages Now Available', N'trackItsValue.com is now out of its infancy and is ready to be released to a larger beta community, and with that comes a greater need for communication to the user base and also a means of introducing the site to new users. Because of this, this News Page and the Welcome Page have been released.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140530 22:45:51.000', '20140530 22:45:51.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'ad090882-d62c-e411-bdbf-00215e73190e', N'Better Mobile Device Support', N'We have streamlined the UI to better support mobile devices of different sizes. The Budget Item Editor dialog was also added to allow changing a Budget Item''s Template after creation for more accurate reports.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140825 23:07:00.000', '20140825 23:07:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'b3fbee39-38e8-e311-821b-00215e73190e', N'Account to Budget Linking', N'Accounts can now be linked to certain types of budget items so that line items from budgets will automatically show up in their corresponding account.  See Help Videos for more information on how to link your accounts in your budgets.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140511 22:55:11.000', '20140511 22:55:11.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'bdb8e138-a40c-e411-91eb-00215e73190e', N'Account Management Changes', N'Account and Account Category Management have been moved to the Accounts Overview Page instead of the Accounts of Type Editor. This is in anticipation of adding Recurring Charges / Payments options to Accounts on the Accounts Overview Page.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140715 23:46:00.000', '20140715 23:46:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'd8ec6ad4-75e8-e311-821b-00215e73190e', N'Site Development Begun', N'Work begins on a new way of tracking wealth on the new site trackItsValue.com, good things to follow!', N'3dc480f1-5586-e311-821b-00215e73190e', 0, 1, '20130917 21:47:00.000', '20130917 21:47:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'df3690f3-38e8-e311-821b-00215e73190e', N'Accounts are Available!', N'Accounts functionality has now been released for use by beta users. See Help Videos for more information on how to setup your accounts.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140421 23:08:00.000', '20140421 23:08:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'e09238b1-9438-e411-8d30-00215e73190e', N'First Account Report Available', N'The "Account Activity by Month" report is now available.', N'3dc480f1-5586-e311-821b-00215e73190e', 1, 1, '20140830 17:35:00.000', '20140830 05:17:00.000', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[News] ([ID], [Title], [Text], [OwnerID], [ItemType], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'e4eabe5a-17fc-e311-80b0-00215e73190e', N'Performance Updates and Minor Bug Fixes', N'Updated the Monthly Budget and the Accounts Editors to have major performance gains when the page has a sigificant amount of data. Fixed menu selection on page reload. Fixed indexing of month on budget copy page.', N'3dc480f1-5586-e311-821b-00215e73190e', 2, 1, '20140624 22:20:00.000', '20140624 22:18:19.817', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[PageContent] ([ID], [PageName], [PageSection], [HtmlContent], [Version], [IsPublished], [PublishedOn], [CreatedOn], [CreatedBy], [ModifiedOn], [ModifiedBy]) VALUES (N'b56ff493-fee2-e311-821b-00215e73190e', N'welcome', N'mainContent', N'<div class="widget-box"><div class="widget-header widget-header-flat"><h4>Welcome to trackItsValue.com</h4></div><div class="widget-body"><div class="widget-main"><p>Welcome to <b>trackItsValue.com</b>, we are glad you have decided to take control of your money!</p><p>In order to help you do this, this site was designed with a few major goals in mind:</p><ul><li>To give you the tools you need to <b>get out of debt</b>, and to stay out of debt permanently.</li><li>To give you insight into how you spend your money; with an eye towards fostering more responsible money management through <b>total income and spending visibility</b>.</li><li>To give you a simple way to track your spending and saving habits over time.</li><li>To be <b>completely anonymous</b>, no need to enter in any account or personal information, you simply need a valid email address and you are ready to use this site.</li></ul><p>Currently, we provide you with three main tools to help you with these goals:</p><h4 class="text-center">A Monthly Zero Based Budget Editor</h4><img class="image-center" src="../../Content/img/BudgetViewSmall.jpg"><p>The monthly budget editor is simple to use, and will allow you to keep track of spending during the entire month. Start to finish, you will always know how much money you have spent and what you have left.</p><h4 class="text-center">A Monthly Account Editor</h4><img class="image-center" src="../../Content/img/AccountsViewSmall.jpg"><p>The monthly account editor will allow you to track your <b>complete wealth picture</b>, showing you all bank and retirement account values, and all current secured and unsecured debt obligations <b>in one consolidated location.</b></p><h4 class="text-center">Budget and Account Analytics</h4><img class="image-center" src="../../Content/img/UtilitiesSpendingSmall.jpg"><p>We provide many different reports that you can run against your budgets and accounts for the month or over years worth of data. This will allow you to view spending and saving habits over time and to see your <b>wealth accumulation and debt reduction!</b></p><h4 class="text-center">trackItsValue.com does this all for free!</h4><p>We will be releasing more new features in the coming months, so managing your money and tracking your net worth will only become simpler. Watch the <a href="http://www.trackItsValue.com/#!/news">News</a> page to see when features are released. And take a look at the <a href="http://www.trackItsValue.com/#!/helpVideos">Videos</a> page to learn how to use all the tools on this site.</p></div></div></div>', 1, 1, '20140523 23:49:00.000', '20140523 23:47:59.310', N'James', NULL, NULL)
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (1, N'James Lendall Basford', N'The man who never has money enough to pay his debts has too much of something else.', '20140516 20:21:08.107', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (2, N'Adam Smith', N'What can be added to the happiness of a man who is in health, out of debt, and has a clear conscience?', '20140516 20:21:41.223', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (3, N'Ogden Nash', N'Some debts are fun when you are acquiring them, but none are fun when you set about retiring them.', '20140516 20:24:05.943', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (4, N'Unknown', N'The only man who sticks closer to you in adversity than a friend is a creditor.', '20140516 20:24:37.987', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (5, N'Unknown', N'Running into debt isn’t so bad. It’s running into creditors that hurts.', '20140516 20:25:30.117', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (6, N'Proverbs 22:7', N'The rich rules over the poor, and the borrower is the slave of the lender.', '20140516 20:26:00.760', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (7, N'Benjamin Franklin', N'Rather go to bed supperless, than rise in debt.', '20140516 20:28:09.867', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (8, N'Dave Ramsey', N'Debt is normal. Be weird.', '20140516 20:28:27.640', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (9, N'Publilius Syrus', N'Debt is the slavery of the free.', '20140516 21:25:32.157', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (10, N'Andrew Jackson', N'When you get in debt you become a slave.', '20140516 21:26:23.397', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (11, N'Benjamin Franklin', N'Tis against some mens principle to pay interest, and seems against others interest to pay the principle.', '20140516 21:26:58.750', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (12, N'Thomas Jefferson', N'Never spend your money before you have it.', '20140516 21:27:23.630', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (13, N'Earl Wilson', N'If you think nobody cares if you’re alive, try missing a couple of car payments.', '20140516 21:28:33.020', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (14, N'Earl Wilson', N'This would be a much better world if more married couples were as deeply in love as they are in debt.', '20140516 21:29:04.677', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (15, N'Ambrose Bierce', N'Debt, n.  An ingenious substitute for the chain and whip of the slavedriver.', '20140516 21:29:42.017', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (16, N'Ralph Waldo Emerson', N'Wouldst thou shut up the avenues of ill, Pay every debt as if God wrote the bill.', '20140516 21:32:11.560', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (17, N'William Shakespeare', N'Neither a borrower nor a lender be; for loan doth oft lose both itself and friend.', '20140516 21:32:35.897', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (18, N'Henry Wadsworth Longfellow', N'He looks the whole world in the face for he owes not any man.', '20140516 21:33:21.060', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (19, N'Thomas Fuller', N'Debt is the worst poverty.', '20140516 21:33:50.890', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (20, N'Edward G. Bulwer-Lytton', N'Youth is in danger until it learns to look upon debts as furies.', '20140516 21:34:20.533', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (21, N'Robert Green Ingersoll', N'A mortgage casts a shadow on the sunniest field.', '20140516 21:37:21.330', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (22, N'Ezra Pound', N'Wars in old times were made to get slaves. The modern implement of imposing slavery is debt.', '20140516 21:38:00.823', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (23, N'Proverbs 13:11', N'Dishonest money dwindles away, but whoever gathers money little by little makes it grow. ', '20170518 10:08:00.000', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (24, N'Hebrews 13:5', N'Keep your lives free from the love of money and be content with what you have, because God has said, “Never will I leave you; never will I forsake you.” ', '20170518 10:10:00.000', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (25, N'Proverbs 10:4', N'Lazy hands make for poverty, but diligent hands bring wealth. ', '20170518 10:12:00.000', N'James')
	INSERT INTO [PublicContent].[Quotes] ([ID], [Source], [Text], [CreatedOn], [CreatedBy]) VALUES (26, N'Luke 14:28', N'Suppose one of you wants to build a tower. Won’t you first sit down and estimate the cost to see if you have enough money to complete it? For if you lay the foundation and are not able to finish it, everyone who sees it will ridicule you.', '20170518 10:14:00.000', N'James')
